import React from 'react'
import './Form.scss'
const Form = () => {
	function checkLink(e){
		e.target.value==""
		return true
	}
	return (
		<form>
			<input onBlur={checkLink} type="text" placeholder="Shorten a link here..."/>
			{checkLink?"aaaa":""}
			<button>Shorten It!</button>
		</form>
	)
}

export default Form
